import React,  {Component} from 'react'
import Movies from './components/movies';

import './App.css';

class App extends Component {
  render(){
  return (
    <div className="App">
    <main className="container">
      <div className="row">
        <div className="col-2">

        </div>
        <div className="col-10">
        <Movies />
        </div>
      </div>  

    </main>
    </div>
  );}
}

export default App;
